import React from 'react';
import { Link } from 'react-router-dom';

const UserSpaces = () => {
  // Dummy data for spaces, replace with real data from API or state
  const spaces = [
    {
      id: 1,
      name: "Space One",
      location: "Location One",
      capacity: "50",
      amenities: "WiFi, Projector",
      rate: "$100/hour",
      image: "path_to_image1.jpg"
    },
    {
      id: 2,
      name: "Space Two",
      location: "Location Two",
      capacity: "100",
      amenities: "WiFi, Catering",
      rate: "$200/hour",
      image: "path_to_image2.jpg"
    },
    // Add more spaces as needed
  ];

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      <div className="bg-white p-6 rounded-lg shadow-lg max-w-3xl w-full mx-4 sm:mx-6 lg:mx-8">
        <h2 className="text-2xl font-bold mb-4 text-center">Available Spaces</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
          {spaces.map((space) => (
            <div key={space.id} className="bg-gray-100 rounded-lg overflow-hidden shadow-md mb-4">
              <img src={space.image} alt={space.name} className="w-full h-48 object-cover" />
              <div className="p-4">
                <h3 className="text-xl font-bold mb-2">{space.name}</h3>
                <p className="text-gray-600 mb-2">Location: {space.location}</p>
                <p className="text-gray-600 mb-2">Capacity: {space.capacity}</p>
                <p className="text-gray-600 mb-2">Amenities: {space.amenities}</p>
                <p className="text-gray-600 mb-4">Rate: {space.rate}</p>
                <div className="flex justify-center">
                  <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline">
                    Book Now
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
        <p className="text-gray-600 text-md text-center mt-4">
          Go back to <Link to="/dashboard" className="text-blue-500">Dashboard</Link>
        </p>
      </div>
    </div>
  );
};

export default UserSpaces;
